import { Heading, Button, useColorMode } from '@chakra-ui/core';
import Layout from '../components/layout/Layout';

const Home = (props) => {
  return (
    <Layout>
      <Heading>HOME</Heading>

      <Button border='1px'>Create account</Button>
      <Icon name='check-circle' size='24px' />
    </Layout>
  );
};

export default Home;
